import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel,Item,Caption } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import tata_safari from './vehicles/tata_safari.jpeg';
import jeeto from './vehicles/mahindra_jeeto.jpeg';
import scorpio from './vehicles/mahindra_scorpio.jpeg';



//create class for nav
class Courasel_style extends Component {

    render() {

        return (<div>
            <Carousel >
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={jeeto}
                        alt="Jeeto"
                    />
                    <Carousel.Caption>
                        <h3>Jeeto</h3>

                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={tata_safari}
                        alt="Safari"

                    />

                    <Carousel.Caption>
                        <h3>Safari</h3>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={scorpio}
                        alt="Scorpio"
                    />

                    <Carousel.Caption>
                        <h3>Scorpio</h3>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>

        </div>)
    }
}

export default Courasel_style;
